package org.tresql

import sys._
import scala.reflect.Manifest
import scala.collection.generic.CanBuildFrom

trait Typed { this: RowLike =>

  def typed[T](columnIndex: Int)(implicit m: Manifest[T]): T = m.toString match {
    case "Int" => int(columnIndex).asInstanceOf[T]
    case "Long" => long(columnIndex).asInstanceOf[T]
    case "Double" => double(columnIndex).asInstanceOf[T]
    case "Boolean" => boolean(columnIndex).asInstanceOf[T]
    case "scala.math.BigDecimal" => bigdecimal(columnIndex).asInstanceOf[T]
    case "java.lang.String" => string(columnIndex).asInstanceOf[T]
    case "java.util.Date" => date(columnIndex).asInstanceOf[T]
    case "java.sql.Date" => date(columnIndex).asInstanceOf[T]
    case "java.sql.Timestamp" => timestamp(columnIndex).asInstanceOf[T]
    case "java.lang.Integer" => jInt(columnIndex).asInstanceOf[T]
    case "java.lang.Long" => jLong(columnIndex).asInstanceOf[T]
    case "java.lang.Double" => jDouble(columnIndex).asInstanceOf[T]
    case "java.math.BigDecimal" => jBigDecimal(columnIndex).asInstanceOf[T]
    case "java.lang.Boolean" => jBoolean(columnIndex).asInstanceOf[T]
    case x if x.startsWith("scala.Tuple") => typed((convTuple[Product] _).asInstanceOf[Converter[T]], m)
    case x if x.startsWith("scala.collection.immutable.List") && m.typeArguments.size == 1 =>
      result(columnIndex).map(_.typed(0)(m.typeArguments.head)).toList.asInstanceOf[T]
    case x => apply(columnIndex).asInstanceOf[T]
  }

  def typed[T](name: String)(implicit m: scala.reflect.Manifest[T]): T

  def typed[T](implicit converter: Converter[T], m: Manifest[T]): T =
    if (converter != null) converter(this, m) else typed(0).asInstanceOf[T]
}

trait TypedResult { this: Result =>
  def head[T](implicit converter: Converter[T], m: Manifest[T]): T = hasNext match {
    case true =>
      next
      val v = this.asInstanceOf[RowLike].typed[T]
      close
      v
    case false => throw new NoSuchElementException("No rows in result")
  }

  def headOption[T](implicit converter: Converter[T],
      m: Manifest[T]): Option[T] = try Some(head[T]) catch {
    case e: NoSuchElementException => None
  }

  def unique[T](implicit converter: Converter[T],
      m: Manifest[T]): T = hasNext match {
    case true =>
      next
      val v = this.asInstanceOf[RowLike].typed[T]
      if (hasNext) {
        close; error("More than one row for unique result")
      } else v
    case false => error("No rows in result")
  }

  def uniqueOption[T](implicit converter: Converter[T],
      m: Manifest[T]): Option[T] = hasNext match {
    case true =>
      next
      val v = this.asInstanceOf[RowLike].typed[T]
      if (hasNext) {
        close; error("More than one row for unique result")
      } else Some(v)
    case false => None
  }

  def toListOfMaps[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): List[M[String, Any]] =
    this.map(r => rowAsMap[M]).toList

  def rowAsMap[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): M[String, Any] = {
    val defaultTransform: PartialFunction[(String, Any), Any] = { case (x, y) => y }
    val tr = if (transformer == null) defaultTransform else transformer orElse defaultTransform
    (bf() ++= (0 to (columnCount - 1)).map(i => {
      val name = column(i).name
      name -> (this(i) match {
        case r: Result => tr(name, r.toListOfMaps[M])
        case x => tr(name, x)
      })
    })).result
  }

  def headAsMap[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): M[String, Any] =
    hasNext match {
      case true =>
        next
        val r = rowAsMap[M]
        close
        r
      case false => throw new NoSuchElementException("No rows in result")
    }

  def headOptionAsMap[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): Option[M[String, Any]] =
    try Some(headAsMap[M]) catch { case e: NoSuchElementException => None }

  def uniqueAsMap[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): M[String, Any] =
    hasNext match {
    case true =>
      next
      val v = rowAsMap[M]
      if (hasNext) {
        close; error("More than one row for unique result")
      } else v
    case false => error("No rows in result")
  }

  def uniqueOptionAsMap[M[String, Any] <: scala.collection.Map[String, Any]](
    implicit transformer: PartialFunction[(String, Any), Any] = null,
    bf: CanBuildFrom[M[String, Any], (String, Any), M[String, Any]]): Option[M[String, Any]] =
    hasNext match {
    case true =>
      next
      val v = rowAsMap[M]
      if (hasNext) {
        close; error("More than one row for unique result")
      } else Some(v)
    case false => None
  }
  
  def list[T](implicit converter: Converter[T],
      m: Manifest[T]) = this.map(r => this.asInstanceOf[RowLike].typed[T]).toList

